import React,{Component} from 'react';

class CardFooter extends Component{
    render(){
        return(
            <div className="card-content">
              <p>Title</p>
              <span>Description</span>
              <img src="/static/images/profile.jpeg"  />
            </div>
        )
    }
}

export default CardFooter;
